      | 49800 -> { ItemTypeData.id= 49800; name= "Drake Chromodynamic Candy SKIN"; published= true; description= "The Chromodynamic Candy Company was a shortlived attempt by a group of Intaki and Ni-Kunni confectionary businesses to leverage the interest in chromodynamic tricarboxyls into a marketing scheme for their new range of festival candies. The intent of selling a range of candies to celebrate the Yoiul Festival, and a variety of local holidays and festivals, fell apart after rumors spread that the candies were laced with the notorious  Deathglow , a hallucinogenic drug manufactured using certain types of chromodynamic tricarboxyls.    While the candies were an abject failure, the striking and colourful livery produced for the promotional campaign still found its way into the hands of capsuleers as a nanocoating that could be used on a variety of popular ships."; marketGroupId= Some(1957); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
