      | 52225 -> { ItemTypeData.id= 52225; name= "Gravid Damage Control Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter devices that mitigate the impact of critical system damage. As such this mutaplasmid could be used to mutate the performance characteristics of standard damage control modules.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool appears to be mature and reproducing at a healthy rate. The mutational benefits and risks of using this mutaplasmid are within relatively balanced bounds."; marketGroupId= Some(2533); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 52322 -> { ItemTypeData.id= 52322; name= "Vedmak Red Meatgrinder SKIN"; published= true; description= "This special commemorative nanocoating celebrates the historic Siege of C-J6MT, a major battle from the early years of capsuleer empire-building and territorial warfare.    In May YC108, the Siege of C-J6MT began as the beleaguered forces of Red Alliance formed to defend their last stronghold against their deadly foes in the  Coalition of the South . Although outnumbered, the Red Alliance pilots were determined to sell themselves dearly and based their tactics around their core defensive starbase and packs of hit-and-run Tempest-class battleships.    When Coalition forces mounted their assault, the starbase and Tempest squadrons wreaked havoc on the attackers. So high was the butcher's bill racked up by the Red Alliance starbase it was given the nickname  The Meatgrinder  by the defenders. Ultimately, the Siege of C-J6MT was won by Red Alliance and proved a turning point in the conflict with the Coalition of the South."; marketGroupId= Some(2485); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
